import { Box, Button, Flex, Grid, GridItem, Spacer, Stack } from '@chakra-ui/react'
import React from 'react'
import styles from "../Body/Body.module.css"
const texts =[
  {title:"SKIN CARE"},
  {title:"SUNSCREEN"},
  {title:"MOISTURIZERS"},
  {title:"HAIR CAIR"},
  {title:"EYE CREAM"},
  {title:"CLENERSE"},
  {title:"MAKEUP"},
  {title:"FACE CREAM"},
 
  
]
 export const textStyles= {
  h1: {
    // you can also use responsive styles
    fontSize: ['48px', '72px'],
    fontWeight: 'bold',
    lineHeight: '110%',
   
  },
  h2: {
    fontSize: ['36px', '48px'],
    fontWeight: 'semibold',
    lineHeight: '110%',
    letterSpacing: '-1%',
  },
}

export const QuickBuyBottom = () => {
  return (
    <div>

        <Grid  templateColumns='repeat(4, 1fr)' gap={4} border="1px solid black" w="95%" m="auto" h="100px" mt="50px" bg="white" >
        {
          texts.map((elem)=>
          (
            <GridItem p="8px" border='2px solid black' >
               {elem.title}
                
            </GridItem>

          ))
         
       }
        </Grid>

        <Box >
          <Flex>
            </Flex>        
                           
        </Box>
    </div>
  )
}
